 INSERT INTO dbo.positions(PositionID, LanguageID, CountryID, PositionSingular, PositionPlural, Aliases, PositionDescription, CreatedDate, UpdatedDate, ModifiedBy, GovID, GovPosition, GovPositionDescription, Active, DisplayRank, PositionSearchDescription, AttributesComplete, StarRatingsComplete, PricingTypeComplete, EnteredByUserID, Approved, CanBeRemote, AddGratuity, HIPAA, SendReviewReminderToClient) VALUES ('346', '1', '1', 'Cat Sitter', 'Cat Sitters', '', 'Ah, the life of a pet. Food, occasional exercise, and lots of sleeping. Almost sounds like childhood again! Find some furry (feathered/scaled) clients to take care of and live the life with.', '2011-07-12 00:00:00.0', '2011-07-12 00:00:00.0', 'jd', '39-2021', 'Nonfarm Animal Caretakers', 'Feed, water, groom, bathe, exercise, or otherwise care for pets and other nonfarm animals, such as dogs, cats, ornamental fish or birds, zoo animals, and mice. Work in settings such as kennels, animal shelters, zoos, circuses, and aquariums. May keep records of feedings, treatments, and animals received or discharged. May clean, disinfect, and repair cages, pens, or fish tanks. Excludes ""Veterinary Assistants and Laboratory Animal Caretakers"" (31-9096).', 1, '1', 'For whatever reason, you need to get away, and little Fluff-Fluff/Sauron the Destroyer needs an experienced, temporary friend to keep him company. Find the perfect playmate for the job.', 1, 0, 0, null, 1, 0, '0', 0, 0);
